import './App.css';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Welcome from './screens/Welcome/index';
import Profile from './screens/Profile';

const App =()=>
<Router>
  <div className='App'>
    {/* <Welcome /> */}
    <Routes>
    <Route path="/" exact component={Welcome} />

          <Route path="/profile">
            <Profile />
          </Route>
          </Routes>
  </div>
  </Router>




export default App;
